function VideoCard() {
    return (
        <div className="relative m-8 h-[299px] w-[180px] rounded-md bg-secondary">
            <img
                className="rounded-md"
                src="https://assets.nick.com/uri/mgid:arc:imageassetref:shared.nick.us:4c36d673-1d5a-4e14-8d26-5b25706e40e8?quality=0.7&gen=ntrn&legacyStatusCode=true"
                y
                alt="Spongebob"
            ></img>
            <div className="absolute bottom-0 h-2/5 w-full rounded-md bg-gradient-to-t from-black to-transparent"></div>
            <h1 className="absolute bottom-4 left-4 font-semibold">
                Spongebob Squarepants
            </h1>
        </div>
    );
}

export default VideoCard;
